import React from 'react'


const Event = () => {
  const htmlString = `<!-- Noscript content for added SEO -->
<noscript><a href="https://www.eventbrite.com/e/eden-and-elijahs-graduation-party-registration-335674299867" rel="noopener noreferrer" target="_blank">Buy Tickets on Eventbrite</a></noscript>
<!-- You can customize this button any way you like -->
<button id="eventbrite-widget-modal-trigger-335674299867" type="button">Buy Tickets</button>

<script src="https://www.eventbrite.com/static/widgets/eb_widgets.js"></script>

<script type="text/javascript">
    var exampleCallback = function() {
        console.log('Order complete!');
    };

    window.EBWidgets.createWidget({
        widgetType: 'checkout',
        eventId: '335674299867',
        modal: true,
        modalTriggerElementId: 'eventbrite-widget-modal-trigger-335674299867',
        onOrderComplete: exampleCallback
    });
</script>`;

  return (
    <div>
       dangerouslySetInnerHTML={{ __html: htmlString }}

    </div >
  )
}

export default Event
